import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="https://pbs.twimg.com/media/BkHApMCCUAAyDjz.jpg:large" />
        <p>
          // {i}日
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <bottun>カレンダーをめくる</bottun>
      </header>
    </div>
  );
}

export default App;
